	<g>
		<text transform="matrix(1 0 0 1 239.5769 568.7412)"><tspan x="0" y="0" class="st0 st1 st11">Logo design is the process of creating a unique symbol, emblem, </tspan><tspan x="0" y="6.6" class="st0 st1 st11">or graphic that represents a brand, organization, product, or service. </tspan><tspan x="0" y="13.2" class="st0 st1 st11">A logo serves as a visual identifier, helping people recognize and associate </tspan><tspan x="0" y="19.8" class="st0 st1 st11">it with a company or cause. It typically includes elements like:</tspan><tspan x="0" y="33" class="st0 st1 st11">Symbols or Icons: Simplified images or graphics representing the brand.</tspan><tspan x="0" y="39.6" class="st0 st1 st11">Typography: Custom fonts or styles used for the company name or tagline.</tspan><tspan x="0" y="46.2" class="st0 st1 st11">Colors: Specific color schemes that align with the brand’s identity and evoke </tspan><tspan x="0" y="52.8" class="st0 st1 st11">emotions.</tspan><tspan x="0" y="59.4" class="st0 st1 st11">Shapes: Geometrical forms that convey meaning or enhance visual appeal.</tspan><tspan x="0" y="66" class="st0 st1 st11">The goal of logo design is to create a memorable, versatile, and timeless </tspan><tspan x="0" y="72.7" class="st0 st1 st11">representation</tspan><tspan x="0" y="79.3" class="st0 st1 st11">that reflects the values and message of the brand. A successful logo </tspan><tspan x="0" y="85.9" class="st0 st1 st11">should be simple, </tspan><tspan x="0" y="92.5" class="st0 st1 st11">distinctive, scalable, and work well across different media and platforms.</tspan></text>
	</g>
	
	<g>
		<text transform="matrix(1 0 0 1 349.2248 878.6085)"><tspan x="0" y="0" class="st0 st1 st6">I am self taught UX Design and </tspan><tspan x="0" y="18" class="st0 st1 st6">logo designer. Currently i have </tspan><tspan x="0" y="36" class="st0 st1 st6">no portfolio to show. I am still learning :)</tspan><tspan x="0" y="54" class="st0 st1 st6">This website is hosted on Azure and DNS </tspan><tspan x="0" y="72" class="st0 st1 st6">provider is godaddy.com</tspan></text>
	</g>
